def count_domain_occurrences(urls):
    domain_counts = {}
    for url in urls:
        domain = urlparse(url).netloc
        if domain not in domain_counts:
            domain_counts[domain] += 1
        else:
            domain_counts[domain] = 1
    return domain_counts

